INSERT INTO `v1_5551998b7790215313e45c0e32816cb36787c7258d1b6444c22980c094430e85` VALUES (82017, 1, 0, 1, 1, "小さいお子様はともかく、動物さんに\n好かれる自覚はありますし……\n冒険者という仕事に不向きなことも、\n自認していますけれど……", 82, 11, 10, 0, 0);
