INSERT INTO `v1_5551998b7790215313e45c0e32816cb36787c7258d1b6444c22980c094430e85` VALUES (82021, 1, 0, 1, 1, "それでも……適性など踏み越えて、\n己の道を突き進むのが冒険者です。\n一度決めたことを、\n曲げるわけには参りません……！", 82, 11, 10, 0, 0);
